import { Component } from "react";
import Layout from "../components/shared/Layout";

class Index extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <Layout>
        <section className="index"></section>;
      </Layout>
    );
  }
}
